import React, { useState } from 'react'

function Login() {
 const [user , setUser] = useState({
  email : "",
  password : ""
 })


 return (
  <div className="login-page">
   <form action="">
    <input type="email" name="email" required placeholder="Email" value={user.email}/>

    <input type="email" name="email" required placeholder="Email" value={user.email}/>
   </form>
  </div>
 )
}

export default Login
